import { Box, Button, Image, Text } from "grommet";
import { FC } from "react";
import { WeatherProps } from "../interfaces/types";

export const Card: FC<WeatherProps> = (props) => {
  return (
    <>
      <Box margin={{ top: "large" }}>
        <Text color="brand">{props.name}</Text>
        {/* <Text color="brand">{props.main.temp}</Text> */}
        <Text color="brand">{props.main.humidity}</Text>
        <Text color="brand">{props.main.temp_max}</Text>
        <Text color="brand">{props.main.temp_min}</Text>
        <Box width="medium">
          {props.weather && (
            <Image
              fit="contain"
              src={
                process.env.BASE_ICON_URL + props.weather[0].icon + "@2x.png"
              }
            />
          )}
        </Box>
        <Button label="See details" />
      </Box>
    </>
  );
};

export default Card;
